USE HSTATS;
DROP TABLE IF EXISTS evolucion_bachillerato;

CREATE TABLE evolucion_bachillerato(
   año                    VARCHAR(9) NOT NULL 
  ,enseñanza              VARCHAR(12) NOT NULL
  ,curso                  INTEGER  NOT NULL
  ,naturaleza             VARCHAR(14) NOT NULL
  ,dencentro              VARCHAR(58) NOT NULL
  ,nombrecentro           VARCHAR(37) NOT NULL
  ,num_matriculados       INTEGER  NOT NULL
);
